import React from 'react'

export default function Interests() {
    return (
        <div className='interests-section'>
            <h3>Interests</h3>
            <p className='interests'>Problem Solver. Critical Thinker. Food expert. Dancer. Reader. Internet fanatic. Entrepreneur. Travel geek. Music lover. Coffee fanatic. Loves cricket and badminton.</p>
        </div>
    )
}
